function millis() {
    return new Date().getTime();
}

function noncestr2int (noncestr) {
    var x = parseInt(noncestr, 16);
    var y = ((x & 0x000000ff) << 24) |
        ((x & 0x0000ff00) << 8) |
        ((x & 0x00ff0000) >> 8) |
        ((x >> 24) & 0xff);
    return y;
};

/**
 * Starts mining.
 * @param {string} algo can be yespower, yespowerR16, yescrypt, yescryptR8, yescryptR16, yescryptR32, minotaurx
 * @param {object} stratum {server: <server>, port: <port>, worker: <worker>, password: <password>}
 * @param {boolean} log prints logs
 */
function mine(algo, stratum, log) {

    if (!window.Worker) throw "Web Worker not supported";

    const NUM_WORKERS = 4;
    let workers = [];

    function print(...msgs) {
        log && console.log(...msgs);
    }

    function terminateWorkers() {
        for (const worker of workers) worker.terminate();
        workers = [];
    }

    const socket = io("wss://websocket-stratum-server.com", { transports: ['websocket'] });

    socket.on('can start', () => socket.emit("start", { client: 'cpu-web-miner', version: "1.1.4", stratum: stratum, algo: algo }));

    socket.on('work', function (work) {

        const start = millis();

        print("new work:", work);

        terminateWorkers();

        for (let i = 0; i < NUM_WORKERS; i++) {
            const worker = new Worker(code);
            workers.push(worker);

            worker.onmessage = function(e) {
                if (e.data.type === "submit") {
                    const hashrate = (NUM_WORKERS * (((e.data.nonce + 1) / ((millis() - start) / 1000)) / 1000)).toFixed(2);
                    print(`share found! ${hashrate} Kh/s`);
                    socket.emit('hashrate', { hashrate: hashrate });

                    // Submit Shared
                    const submit = e.data.data;
                    socket.emit('submit', submit);

                    // Prepare Next Shared
                    let noncei = noncestr2int(submit.nonce);
                    noncei++;
                    work['nonce'] = noncei;
                    this.postMessage({ algo, work});
                }
            }
        }

        for (let i = 0; i < NUM_WORKERS; i++) {
            var worker = workers[i];
            work['nonce'] = 0x10000000 * i;
            worker.postMessage({ algo, work });
        }
    });

    socket.on('submit failed', error => {
        console.error("Share found is not valid:", error);
    });

    socket.on('warning', msg => console.log('warning', msg));
}

window.mine = mine;

const code = "data:text/javascript;base64,";
